        loader can''t resolve `@import`s, throws error. Config file is just fine,
        but `sass-loader` throws errors anyhow:\r\n\r\n```\r\nERROR in ./assets/sass/index.scss\r\nModule
        parse failed: C:\\Users\\user\\app\\assets\\sass\\index.scss Unexpected character
