        [\r\n                ''css-loader?minimize'',\r\n                ''sass-loader''\r\n            ]\r\n        },\r\n        {\r\n            test:
        /\\.css$/i,\r\n            loader: ''css-loader?-minimize'',\r\n\r\n        },\r\n        {\r\n            test:
        /\\.js$/i,\r\n            exclude: /(node_modules|bower_components)/,\r\n            loader:
        ''babel-loader'',\r\n            query: {\r\n                presets: [''es2015'',
        \"stage-0\", \"react\"]\r\n            }\r\n        }\r\n    ]\r\n},\r\nsassLoader:
        {\r\n    indentWidth: 4,\r\n    outputStyle: ''expanded'',\r\n    sourceComments:
        true,\r\n},\r\ntarget: ''node''\r\n```\r\n\r\nTwo `.scss` files.\r\n\r\n`index.scss`:\r\n```\r\n@import
        \"_one\";\r\n\r\n.text {\r\n    color: red;\r\n    font-style: italic;\r\n}\r\n```\r\n\r\n`one.scss`:\r\n```\r\n.key
        {\r\n    background-color: #ccc;\r\n}\r\n```\r\n\r\nApp file:\r\n```\r\nlet
        css = require(''index.scss'');\r\n```\r\n\r\nWhy error?\r\n\r\n**PS**:\r\n\r\nHowever,
        it works all right if I call loaders inline:\r\n```\r\nlet css = require(''css-loader!sass-loader!index.scss'');\r\n```\r\n\r\nWhy?
